import React, { useEffect, useState } from "react";

export default function TACGenerator() {
  const [code, setCode] = useState("");
  const [tac, setTac] = useState("");
  const [animate, setAnimate] = useState(false);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    setTimeout(() => setAnimate(true), 500);
  }, []);

  const generateTAC = async () => {
    try {
      setLoading(true);
      setError(null);
      const response = await fetch("http://localhost:3000/api/generate-tac", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ code }),
      });

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.error || "Failed to generate TAC");
      }

      const data = await response.json();
      setTac(data.tac);
    } catch (err) {
      setError(err.message);
      setTac("");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div
      style={{
        display: "flex",
        minHeight: "100vh",
        background: "black",
        color: "white",
        fontFamily: "monospace",
        overflow: "hidden",
      }}
    >
      {/* Left Side - Input */}
      <div
        style={{
          flex: 1,
          padding: "20px",
          borderRight: "3px solid #ff00ff",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          transform: animate ? "translateX(0)" : "translateX(-100%)",
          transition: "transform 0.8s ease-in-out",
        }}
      >
        <h2 style={{ textShadow: "0 0 8px #ff00ff", animation: "glow 1.5s infinite alternate" }}>
          💻 Enter Code
        </h2>
        <textarea
          rows="15"
          cols="50"
          placeholder="Enter C-like code...
Example:
for(int i = 0; i < 10; i++) {
    if(i % 2 == 0) {
        x = x + 1;
    } else {
        y = y + 1;
    }
}"
          value={code}
          onChange={(e) => setCode(e.target.value)}
          style={{
            width: "90%",
            padding: "12px",
            borderRadius: "8px",
            background: "#222",
            color: "#0f0",
            fontSize: "1.1rem",
            border: "2px solid #ff00ff",
            boxShadow: "0 0 10px #ff00ff",
            resize: "vertical",
          }}
        />
        <button
          onClick={generateTAC}
          disabled={loading || !code.trim()}
          style={{
            marginTop: "20px",
            padding: "12px 25px",
            fontSize: "1.2rem",
            fontWeight: "bold",
            borderRadius: "8px",
            border: "none",
            background: loading || !code.trim() 
              ? "linear-gradient(90deg, #666, #999)"
              : "linear-gradient(90deg, #ff0000, #ffcc00)",
            color: "white",
            cursor: loading || !code.trim() ? "not-allowed" : "pointer",
            transition: "0.3s",
            boxShadow: "0 0 15px #ffcc00",
            opacity: loading || !code.trim() ? 0.7 : 1,
          }}
          onMouseOver={(e) => {
            if (!loading && code.trim()) {
              e.target.style.transform = "scale(1.1)";
              e.target.style.boxShadow = "0 0 20px #ffcc00";
            }
          }}
          onMouseOut={(e) => {
            if (!loading && code.trim()) {
              e.target.style.transform = "scale(1)";
              e.target.style.boxShadow = "0 0 15px #ffcc00";
            }
          }}
        >
          {loading ? "⚙️ Generating..." : "🚀 Generate TAC 🚀"}
        </button>
      </div>

      {/* Right Side - Output */}
      <div
        style={{
          flex: 1,
          padding: "20px",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          transform: animate ? "translateX(0)" : "translateX(100%)",
          transition: "transform 0.8s ease-in-out",
        }}
      >
        <h2 style={{ textShadow: "0 0 8px #00ffff", animation: "glow 1.5s infinite alternate" }}>
          ⚡ Generated TAC ⚡
        </h2>
        <div
          style={{
            width: "90%",
            minHeight: "60vh",
            padding: "12px",
            borderRadius: "10px",
            background: "#222",
            color: "#ffcc00",
            fontSize: "1.1rem",
            border: "2px solid #00ffff",
            boxShadow: "0 0 10px #00ffff",
            overflow: "auto",
            whiteSpace: "pre-wrap",
            transition: "0.3s",
          }}
        >
          {error ? (
            <div style={{ color: "#ff4444", padding: "10px" }}>
              ❌ Error: {error}
            </div>
          ) : tac ? (
            <pre>{tac}</pre>
          ) : (
            <p style={{ opacity: 0.5 }}>TAC will be displayed here...</p>
          )}
        </div>
      </div>

      {/* CSS Animations */}
      <style>
        {`
          @keyframes glow {
            from {
              text-shadow: 0 0 10px #ff00ff, 0 0 20px #ff00ff;
            }
            to {
              text-shadow: 0 0 20px #ff00ff, 0 0 30px #ff00ff;
            }
          }
        `}
      </style>
    </div>
  );
}
